  render() {
    return (
      <div>
        <Head>
        <title>I'm Marcus Foo</title>
        </Head>
        <Layout />
        <Hero />
        
        <h1>Here's what I've done so far</h1>

       <style jsx>{`
            h1 {
              padding: 20rem;
              color:red;
            }
       `} </style> 
      </div>
    )
  }
}

export default index
